// sign_up.js
import React, { useState } from 'react';
import './sign_up.css'; 
import logo from '../assets/logo.png';  // Import the logo image


const SignUp = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    confirmPassword: '',
    phone: '',
    emergencyContact: '',
    dateOfBirth: '',
    nationality: '',
    gender: '',
    medicalHistory: '',
    reasonForTherapy: '',
    agreement: false
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission here, e.g., send data to backend
    console.log(formData);
  };

  return (
    
    <div className="sign-up-container">
      <div className="logo-container">
        <img src={logo} alt="Therapedia Logo" className="logo" />
      </div>

      <h1>Ready to get started ?</h1>
      <h2>Sign Up to Therapedia</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
        
          <input
            type="text"
            name="firstName"
            placeholder= " ðŸ‘¤  First Name"
            value={formData.firstName}
            onChange={handleChange}
            required
          /> &nbsp; &nbsp;
          <input
            type="text"
            name="lastName"
            placeholder=" ðŸ‘¤  Last Name"
            value={formData.lastName}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="email"
            name="email"
            placeholder=" ðŸ“§  Email Address"
            value={formData.email}
            onChange={handleChange}
            required
          /> 
        </div>
        <div className="form-group">
          <input
            type="password"
            name="password"
            placeholder=" ðŸ”’ Password"
            value={formData.password}
            onChange={handleChange}
            required
          /> &nbsp; &nbsp;
          <input
            type="password"
            name="confirmPassword"
            placeholder=" ðŸ”’ Confirm Password"
            value={formData.confirmPassword}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <input
            type="number"
            name="phone"
            placeholder=" ðŸ“ž Phone Number"
            value={formData.phone}
            onChange={handleChange}
          /> &nbsp; &nbsp;
          <input
            type="number"
            name="emergencyContact"
            placeholder=" ðŸ“ž Emergency Contact"
            value={formData.emergencyContact}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ðŸ“… &nbsp; Date of Birth: </label>  &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
          <input
            type="date"
            name="dateOfBirth"
            placeholder="Date of Birth"
            value={formData.dateOfBirth}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
        <div className="input-container">
  <div className='genderco'>
  <select
    name="gender"
    value={formData.gender}
    onChange={handleChange}
    required
  >
    <option value=""> ðŸš» Select Gender</option>
    <option value="male">Male</option>
    <option value="female">Female</option>
    <option value="male">Non-Binary</option>
    <option value="other">Other</option>
    <option value="female">Prefer Not to Say</option>
  </select>
  </div>
</div>
        </div>
        <div className="form-group">
          <textarea
            name="medicalHistory"
            placeholder=" ðŸ“ Medical History"
            value={formData.medicalHistory}
            onChange={handleChange}
          ></textarea>
        </div>
        <div className="form-group">
          <textarea
            name="reasonForTherapy"
            placeholder=" ðŸ“ Reason for Seeking Therapy"
            value={formData.reasonForTherapy}
            onChange={handleChange}
          ></textarea>
        </div>
        <div className="form-group">
          <input
            type="checkbox"
            name="agreement"
            checked={formData.agreement}
            onChange={(e) => setFormData(prevState => ({ ...prevState, agreement: e.target.checked }))}
            required
          />
          <label>I agree to <a href="/path/to/your.pdf" target="_blank" rel="noopener noreferrer">the rules and conditions of Therapedia</a> </label>
        </div>
        <button type="submit">Sign Up</button>
      </form>
    </div>
  );
};

export default SignUp;
